// ListagemItem.js
import React from 'react';
import './ListagemItem.css';

const ListagemItem = ({ simulacao }) => {
  return (
    <div className="simulacao-details">
      <h2>Detalhes da Simulação</h2>
      <p>ID: {simulacao.id}</p>
      <p>Nome Completo: {simulacao.nomeCompleto}</p>
      <p>Email: {simulacao.email}</p>
      <p>Telefone: {simulacao.telefone}</p>

      <h3>Unidades</h3>
      {simulacao.unidades.map((unidade) => (
        <div key={unidade.id} className="unidade-details">
          <p>ID da Unidade: {unidade.id}</p>
          <p>Código da Unidade Consumidora: {unidade.codigoDaUnidadeConsumidora}</p>
          <p>Modelo Fasico: {unidade.modeloFasico}</p>
          <p>Enquadramento: {unidade.enquadramento}</p>

          <h4>Histórico de Consumo</h4>
          <table className="consumo-table">
            <thead>
              <tr>
                <th>Mês do Consumo</th>
                <th>Consumo Fora de Ponta (KWH)</th>
              </tr>
            </thead>
            <tbody>
              {unidade.historicoDeConsumoEmKWH.map((consumo) => (
                <tr key={consumo.mesDoConsumo}>
                  <td>{consumo.mesDoConsumo}</td>
                  <td>{consumo.consumoForaPontaEmKWH}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
};

export default ListagemItem;
